import React from 'react';
import { Button } from 'antd';

const Task = ({ userData}) => {
  const { filteredTasks, refetchDataAndFilter } = useTaskData(userData);
    return (
        <div style={{ padding: '20px' }}>
            <h2>Görevleriniz:</h2>
            {filteredTasks.length > 0 ? (
                filteredTasks.map((task, index) => (
                    <Button key={index} style={{ marginBottom: '10px' }} block>
                        {task}
                    </Button>
                ))
            ) : (
                "Yükleniyor..."
            )}
        </div>
    );
};

export default Task;
